import { Box, Typography } from "@mui/material"

const PokemonCard = (pokemon) => {
    return (
        <Box sx={{
            flex: '1 1 484px',
            bgcolor: '#000000',
            p: 5.5,
            boxSizing: 'border-box',
        }}>
            {
                pokemon && 
                <Typography component='h1' sx={{
                    color: '#ffffff',
                    fontSize: 48,
                }}>
                    {pokemon.name[0].toUpperCase() + pokemon.name.slice(1)}
                </Typography>
            }
        </Box>
    )
}
